// Import package
import React, { Component } from "react";
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';

import Carousel from "../Component/Home/Carousel";
import Catagories from "../Component/Home/Catagories";
import NewProducts from "../Component/Home/NewProducts";
import Search from "../Component/Search";

import { Link } from 'react-router-dom';
import Product from "../Component/Product";


class Shop extends Component {
    render() {
        return (
            <div className="App">
                <div class="jumbotron jumbo-store">
                    <p><img src={this.props.image} width="70%" alt="" /></p>
                    <p class="lead">This is our store.</p>
                    <hr class="my-4" />
                    <p>You can buy any retro stuff here with best deal.</p>
                </div>


                <Search />
                <h1 class="mt-5 pt-5" style={{ fontWeight: 700 }}>We Sell Stuff For Your Retro Desire</h1>
                <Product />
            </div>
        );
    }
}
export default withRouter(Shop)
